import React from 'react';
import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div>
        <Routes>
          <Route path={'/hello'} element={<HelloPage />}/>

        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
